import { GET_RELATIONSHIPS} from "../actions/types";
const initialState = {
    relation: []
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_RELATIONSHIPS:
      console.log(action.payload);
      return {
        ...state,
        relation:action.payload
    };
    default:
      return state;
  }
}
